// ==UserScript==
// @name         Favicon swap
// @namespace    https://lou.io
// @version      2025-01-30
// @description  Swap out favicon for Lou's priorities scratchpad
// @author       You
// @match        https://docs.google.com/document/d/1E_8JGGfLYwVfGqSA9kgSOlqrrYBFjrYtv8LuVDrW3O0/edit*
// @icon         data:image/gif;base64,
// @grant        none
// ==/UserScript==

(function() {
    'use strict';

    function changeFavicon(base64Image) {
        let link = document.querySelector("link[rel*='icon']") || document.createElement('link');
        link.type = 'image/png';
        link.rel = 'icon';
        link.href = base64Image;

        document.head.appendChild(link);
    }

    const base64Favicon = "data:image/png;base64,";

    changeFavicon(base64Favicon);
})();
